from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up all devices.
prime_hub = PrimeHub()
motor = Motor(Port.A, Direction.CLOCKWISE)
motor2 = Motor(Port.B, Direction.COUNTERCLOCKWISE)
front = Motor(Port.E, Direction.COUNTERCLOCKWISE)
back = Motor(Port.F, Direction.CLOCKWISE)
drive_base = DriveBase(motor2, motor, 81.6, 101.7182)

async def main1():
    drive_base.use_gyro(True)
    await drive_base.turn(-20)
    drive_base.settings(straight_speed=400)
    await drive_base.straight(-700)
    drive_base.settings(straight_speed=200)
    await drive_base.turn(15)
    await drive_base.straight(-70)
    await back.run_angle(1200, 1000)
    await back.run_angle(1200, -1900)
    # finish run wheel to reveal whale
    await drive_base.turn(-70)
    await drive_base.straight(-70)
    await multitask(back.run_angle(1200, -700), drive_base.straight(-80))
    await drive_base.turn(12)
    await drive_base.straight(-115)
    await drive_base.turn(124)
    drive_base.settings(straight_speed=400)
    await drive_base.straight(300)
    await drive_base.straight(-105)
    await drive_base.turn(10)
    await drive_base.straight(110)
    # Hit Anglar Fish 2nd
    await drive_base.straight(-80)
    await drive_base.curve(30, 90)
    await drive_base.straight(-330)
    await drive_base.turn(30)
    # ready to put the arm down
    await front.run_angle(200, 360)
    await wait(500)
    await front.run_angle(300, -360)
    await drive_base.straight(-50)
    await drive_base.turn(75)
    drive_base.settings(straight_speed=1000)
    await drive_base.straight(-1100)
    # done at 3:09 PM at November 4th

async def main2():
    pass


async def main():
    await multitask(main1(), main2())

run_task(main())